import Footer from './components/Footer.js';
import Latestprojects from './components/Latestprojects.js';
import Services from './components/Services.js';
import About from './components/About.js';
import Landingsection from './components/Landingsection.js';
import Header from './components/Header.js';
import logo from './logo.svg';
import './App.css';
import Preloader from './components/Preloader.js';

function App() {
  return (
    <>
     {/* <!--PRELOADER--> */}

  <div className="prague-loader">
      <div className="prague-loader-wrapper">
          <div className="prague-loader-bar">
              ANDREA PEREZ
          </div>
      </div>
  </div>
  {/* <!--/PRELOADER--> */}

  <Header />
  <Landingsection />
  <About />
  <Services />
  <Latestprojects />
  <Footer />
  <Preloader />


    </>
  );
}

export default App;
